Receita de bolo de laranja

Ingredientes:
Suco de 2 laranjas;
1 xícara (chá) de óleo;
2 xícaras (chá) de farinha de trigo;
4 ovos;
1 colher (sopa) de fermento;
Casca de 1 laranja;
2 xícaras (chá) de açúcar.

Modo de preparo:
Para começar, você deve lavar a casca da laranja e cortar em pequenos pedaços;
Feito isso, coloque-as no liquidificador com os ovos, o açúcar, o óleo e o suco das laranjas. Bata;
Quando obtiver uma mescla homogênea, transfira o líquido para uma tigela e acrescente o fermento e a farinha de trigo. Misture novamente;
Então, distribua sua massa em uma forma devidamente untada com margarina e farinha;
Depois disso, leve ao forno pré-aquecido e mantenha por cerca de 30 minutos ou até seu garfo ou palito sair seco.
Dica de ouro: depois que assar, faça alguns furinhos no seu bolo e regue com suco de laranja.

